INSERT INTO KSLU_RICH_TEXT_T (VER_NBR, OBJ_ID, ID, FORMATTED, PLAIN) VALUES (0, 'c7027428-4a9b-4108-b203-5662612a82ba', '0b90ee4d-0aa2-4fab-a160-73d872bd2012', 'A seminar designed for students who are planning to complete their Ph.D. in Criminology and Criminal Justice. Focus on issues important to consider during one''s career. Discussions and activities will include topics such as: planning one''s graduate career, resumes, planning a professional career, employment opportunities, interviewing for jobs, teaching, publishing and reviewing manuscripts, grants and proposals, research, achieving tenure.', 'A seminar designed for students who are planning to complete their Ph.D. in Criminology and Criminal Justice. Focus on issues important to consider during one''s career. Discussions and activities will include topics such as: planning one''s graduate career, resumes, planning a professional career, employment opportunities, interviewing for jobs, teaching, publishing and reviewing manuscripts, grants and proposals, research, achieving tenure.')
