INSERT INTO KSLU_RICH_TEXT_T (VER_NBR, OBJ_ID, ID, FORMATTED, PLAIN) VALUES (0, 'f2c1922d-bd81-4e68-8397-b710abc92abf', '0de2157e-8fc4-435b-8ef7-22f5a393cbaa', 'Data and materials can originate from an internship (internal or external) or from relevant work experience with current employer. Under direction of faculty advisor, students will prepare a project report containing explanation of the requirements for the work, technical account of the activities undertaken, including literature review, description of methods and approaches taken, a critical discussion of results, along with conclusions and recommendations developed from the project. Final project will consist of a full-fledged GIS application that is up and running and can be tested, providing potential employers  with a portfolio demonstrating student''s ability to manage and develop a GIS application in real world situations.', 'Data and materials can originate from an internship (internal or external) or from relevant work experience with current employer. Under direction of faculty advisor, students will prepare a project report containing explanation of the requirements for the work, technical account of the activities undertaken, including literature review, description of methods and approaches taken, a critical discussion of results, along with conclusions and recommendations developed from the project. Final project will consist of a full-fledged GIS application that is up and running and can be tested, providing potential employers  with a portfolio demonstrating student''s ability to manage and develop a GIS application in real world situations.')
/
