INSERT INTO KSLU_RICH_TEXT_T (VER_NBR, OBJ_ID, ID, FORMATTED, PLAIN) VALUES (0, 'c8075d86-0007-4580-8860-86a765977359', '12cb8b50-0df4-4afe-98bd-51f373aef73f', 'Provides the opportunity to experience different laboratory environments. Students gain exposure to graduate research, learn a wide variety of laboratory and/or computational techniques, become familiar with Bioengineering program faculty, and develop insight on personal research interests and direction. Laboratory rotations are required in Fall and Spring of the first year of the Ph.D. Program. BIOE605: Laboratory Rotations I will be held in the Fall semester. BIOE606: Laboratory Rotations II will be held in the Spring semester.', 'Provides the opportunity to experience different laboratory environments. Students gain exposure to graduate research, learn a wide variety of laboratory and/or computational techniques, become familiar with Bioengineering program faculty, and develop insight on personal research interests and direction. Laboratory rotations are required in Fall and Spring of the first year of the Ph.D. Program. BIOE605: Laboratory Rotations I will be held in the Fall semester. BIOE606: Laboratory Rotations II will be held in the Spring semester.')
/
