INSERT INTO KSLU_RICH_TEXT_T (VER_NBR, OBJ_ID, ID, FORMATTED, PLAIN) VALUES (0, 'a3488bd5-076d-4861-9a6b-1e5bc5857d08', '13dfc69a-e58e-4145-b181-b3fe1c68afa6', 'It is an overview of ecosystem ecology concepts and thus will address multiple topics including: ecosystem definition, primary/secondary productivity, ecosystem energetics, trophic structure, stability/resilience, nutrient cycling, ecosystem management, and the importance of ecological models. To the extent possible, examples for discussion will be drawn from multiple ecosystem types to facilitate comparison among ecosystems. Course presentation will be a combination of lectures by the instructor, guest lectures, and discussion sessions.', 'It is an overview of ecosystem ecology concepts and thus will address multiple topics including: ecosystem definition, primary/secondary productivity, ecosystem energetics, trophic structure, stability/resilience, nutrient cycling, ecosystem management, and the importance of ecological models. To the extent possible, examples for discussion will be drawn from multiple ecosystem types to facilitate comparison among ecosystems. Course presentation will be a combination of lectures by the instructor, guest lectures, and discussion sessions.')
/
