INSERT INTO KSLU_RICH_TEXT_T (VER_NBR, OBJ_ID, ID, FORMATTED, PLAIN) VALUES (0, '2ac13bf3-cdcb-4aa5-b9e3-d5470abd3ba5', '19a442a0-c7e6-4558-a680-d18cf1099823', 'This course is designed for graduate students with an interest in the use of latent variables in longitudinal data analysis as it is conceptualized in the Mplus framework. This course explores more general features of latent variable analyses as they are related to longitudinal modeling. Topics to be covered include latent growth analysis with a combination of continuous and categorical latent variables as well as the inclusion of continuous and categorical variables as predictors and outcomes.', 'This course is designed for graduate students with an interest in the use of latent variables in longitudinal data analysis as it is conceptualized in the Mplus framework. This course explores more general features of latent variable analyses as they are related to longitudinal modeling. Topics to be covered include latent growth analysis with a combination of continuous and categorical latent variables as well as the inclusion of continuous and categorical variables as predictors and outcomes.')
/
