INSERT INTO KSLU_RICH_TEXT_T (VER_NBR, OBJ_ID, ID, FORMATTED, PLAIN) VALUES (0, '5c53c0d5-5418-4a94-8f0c-6cf1f0cfcf6e', '1e4045dd-cd6e-41f7-b310-d8a6ae9c2ea6', 'An investigation of how biodiversity and ecological processes affect human health. Humans as integral but unique members of ecosystems whose well-being depends on a range of complex ecological services will be viewed. Topics will include human-induced environmental changes, species invasions, species interactions, medicines from nature, and infectious diseases. Students will lead class discussion of peer-reviewed literature and complete an assignment writing a research grant proposal. The lab will involve researching native and introduced species of medical importance.', 'An investigation of how biodiversity and ecological processes affect human health. Humans as integral but unique members of ecosystems whose well-being depends on a range of complex ecological services will be viewed. Topics will include human-induced environmental changes, species invasions, species interactions, medicines from nature, and infectious diseases. Students will lead class discussion of peer-reviewed literature and complete an assignment writing a research grant proposal. The lab will involve researching native and introduced species of medical importance.')
/
