INSERT INTO KSLU_RICH_TEXT_T (VER_NBR, OBJ_ID, ID, FORMATTED, PLAIN) VALUES (0, '0f33a449-3447-41ed-82e6-ec05adf75a1a', '2057b330-363e-436d-8159-ae6e62117a59', 'Landscape ecology emphasizes spatial patterning--its causes, development, and importance for ecological processes. Students will become familiar with concepts, methods, and applications of landscape ecology through reading classic and contemporary literature representative of state-of-the-art research; class lectures; completion of two projects designed to provide "hands on" experience with some of the quantitative methods and tools; and completion of one independent project.', 'Landscape ecology emphasizes spatial patterning--its causes, development, and importance for ecological processes. Students will become familiar with concepts, methods, and applications of landscape ecology through reading classic and contemporary literature representative of state-of-the-art research; class lectures; completion of two projects designed to provide "hands on" experience with some of the quantitative methods and tools; and completion of one independent project.')
/
