INSERT INTO KSLU_RICH_TEXT_T (VER_NBR, OBJ_ID, ID, FORMATTED, PLAIN) VALUES (0, '47c45d8e-5f14-41cb-a323-48696970b2c9', '4c8aed5f-9b5c-45ea-a2e2-bf6cd7f8b9cd', 'A seminar designed to increase knowledge of the criminal behavior of adults and juveniles and what can be done to change this behavior. Students will be expected to develop a thorough understanding of the history, development, operation, effectiveness, and future of formal efforts to understand and control criminal behavior.', 'A seminar designed to increase knowledge of the criminal behavior of adults and juveniles and what can be done to change this behavior. Students will be expected to develop a thorough understanding of the history, development, operation, effectiveness, and future of formal efforts to understand and control criminal behavior.')
/
INSERT INTO KSLU_RICH_TEXT_T (VER_NBR, OBJ_ID, ID, FORMATTED, PLAIN) VALUES (0, '9472def5-105d-45b0-a9e2-58d7a8c4ed69', '4ca41243-c884-4fb0-8fe3-995bc44de7a0', 'A hands-on study of computer hardware and software that makes use of the MIDI (Musical Instrument Digital Interface) specification. This protocol allows computers, synthesizers and various other devices to send and receive information about musical performance, notation and sound. The course focuses on two of the most frequently used applications on MIDI -- sequencing and music notation. Also included is an introduction to digital audio. No previous experience with computers is required. Ability to read music on a grand staff (treble and bass clef) is recommended.', 'A hands-on study of computer hardware and software that makes use of the MIDI (Musical Instrument Digital Interface) specification. This protocol allows computers, synthesizers and various other devices to send and receive information about musical performance, notation and sound. The course focuses on two of the most frequently used applications on MIDI -- sequencing and music notation. Also included is an introduction to digital audio. No previous experience with computers is required. Ability to read music on a grand staff (treble and bass clef) is recommended.')
/
