INSERT INTO KSLU_RICH_TEXT_T (VER_NBR, OBJ_ID, ID, FORMATTED, PLAIN) VALUES (0, '4d32731d-0444-49f6-a090-4e86250413ec', '4ddfa0a5-935c-4f58-b22f-eef6090811ca', 'Implementing and reporting GIS projects is one of the required skills fo r professional GIS practitioners. This course will introduce the components, procedure and methods of implementing, reporting, and managing a GIS project. Students will implement the project proposal developed in GEOG793, Professional Project I. The project will be a GIS application that can be tested, demonstrating the student''s ability to manage and develop a GIS application project in a real world situation.', 'Implementing and reporting GIS projects is one of the required skills fo r professional GIS practitioners. This course will introduce the components, procedure and methods of implementing, reporting, and managing a GIS project. Students will implement the project proposal developed in GEOG793, Professional Project I. The project will be a GIS application that can be tested, demonstrating the student''s ability to manage and develop a GIS application project in a real world situation.')
