INSERT INTO KSLU_RICH_TEXT_T (VER_NBR, OBJ_ID, ID, FORMATTED, PLAIN) VALUES (0, '834f9549-1748-4091-b99f-09c19d851e40', '6a05dbf6-7e45-474a-a9b1-85e23bd700b1', 'Plant ecological genetics is focused on the processes responsible for evolution in plant populations. Covers the basic principle of population genetics, then quickly shifts towards understanding how allele frequencies can change in an ecological context. Emphasis is placed on the role of drift and selection in evolution, and particular attention is placed on plant mating system evolution.', 'Plant ecological genetics is focused on the processes responsible for evolution in plant populations. Covers the basic principle of population genetics, then quickly shifts towards understanding how allele frequencies can change in an ecological context. Emphasis is placed on the role of drift and selection in evolution, and particular attention is placed on plant mating system evolution.')
