INSERT INTO KSLU_RICH_TEXT_T (VER_NBR, OBJ_ID, ID, FORMATTED, PLAIN) VALUES (0, 'fc976b81-ca14-4a58-b4f8-60c306ce5234', '7557962b-a94e-4c4e-a27f-acd7acd26dc2', 'A practical introduction to the main topics in algorithms, databases, and tools used in bioinformatics. Includes public databases such as Genbank and PDG, software tools such as BLAST, and their underlying algorithms. Use of Perl scripting language to perform a number of useful tasks in analyzing sequence data and managing bioinformatic databases.', 'A practical introduction to the main topics in algorithms, databases, and tools used in bioinformatics. Includes public databases such as Genbank and PDG, software tools such as BLAST, and their underlying algorithms. Use of Perl scripting language to perform a number of useful tasks in analyzing sequence data and managing bioinformatic databases.')
/
INSERT INTO KSLU_RICH_TEXT_T (VER_NBR, OBJ_ID, ID, FORMATTED, PLAIN) VALUES (0, '91b75cde-80ba-42b4-8931-0bdbf6ed2339', '755c0c31-2194-4b2e-b78f-a1d63868f972', 'Two one-hour lectures and one three-hour laboratory per week. General organization and development of insects, the body well and its derivatives, body regions, sclerites and segmentation, segmental appendages, head and its appendages, thorax, legs and wings, the abdomen, alimentary canal, organs of distribution, respiratory system, nervous system, sense organs, and the reproductive organs. Dissections of selected systems of a grasshopper .', 'Two one-hour lectures and one three-hour laboratory per week. General organization and development of insects, the body well and its derivatives, body regions, sclerites and segmentation, segmental appendages, head and its appendages, thorax, legs and wings, the abdomen, alimentary canal, organs of distribution, respiratory system, nervous system, sense organs, and the reproductive organs. Dissections of selected systems of a grasshopper .')
/
