INSERT INTO KSLU_RICH_TEXT_T (VER_NBR, OBJ_ID, ID, FORMATTED, PLAIN) VALUES (0, '015459ba-6e2b-41ce-9721-42aefef4640f', '775b6b33-6467-4d84-b06a-3f998529c6fc', 'Designed to provide an intensive examination of crime and the life course. Life course is examined as a theoretical orientation, a research methodology, and an empirical field of study with special reference to crime and deviance. Course includes development of criminal behavior and criminal careers; stability and change in criminal behavior across developmental stages; trajectories, transitions, and turning points through life; quantitative and qualitative approaches to studying crime and the life course; and social change and its link to individual lives.', 'Designed to provide an intensive examination of crime and the life course. Life course is examined as a theoretical orientation, a research methodology, and an empirical field of study with special reference to crime and deviance. Course includes development of criminal behavior and criminal careers; stability and change in criminal behavior across developmental stages; trajectories, transitions, and turning points through life; quantitative and qualitative approaches to studying crime and the life course; and social change and its link to individual lives.')
