INSERT INTO KSLU_RICH_TEXT_T (VER_NBR, OBJ_ID, ID, FORMATTED, PLAIN) VALUES (0, 'cdcce3b8-41dc-486c-b023-33b54422ed65', '8103504c-cf94-499d-bd60-ba7f3bf2d57a', 'Application of simple dynamic systems and optimization models to understand the dynamics of populations and ecological communities; population growth, predator-prey interactions, competition, food webs, foraging theory, and evolution of life histories. Instruction and use of the program Mathematica.', 'Application of simple dynamic systems and optimization models to understand the dynamics of populations and ecological communities; population growth, predator-prey interactions, competition, food webs, foraging theory, and evolution of life histories. Instruction and use of the program Mathematica.')
