INSERT INTO KSLU_RICH_TEXT_T (VER_NBR, OBJ_ID, ID, FORMATTED, PLAIN) VALUES (0, 'a20c499b-cdf8-4316-8264-552cc75d8b5a', '811a1d81-f5c0-4155-ab65-c1ab0c727298', 'Examine the factors that have led to recent police innovations and recent innovations in the study of policing. Critically explores the effects of such policies on crime and disorder, on research practices, as well as unintended consequences on community, police abuse and police organization. Which policies have been found to be effective? What types of practices work most effectively for what type of crime and disorder problems? Has there been sufficient research for us to come to solid conclusions regarding these questions? Does present research fit the practices of the police?', 'Examine the factors that have led to recent police innovations and recent innovations in the study of policing. Critically explores the effects of such policies on crime and disorder, on research practices, as well as unintended consequences on community, police abuse and police organization. Which policies have been found to be effective? What types of practices work most effectively for what type of crime and disorder problems? Has there been sufficient research for us to come to solid conclusions regarding these questions? Does present research fit the practices of the police?')
/
