INSERT INTO KSLU_RICH_TEXT_T (VER_NBR, OBJ_ID, ID, FORMATTED, PLAIN) VALUES (0, 'a3e8c8a8-cb3d-4754-9415-442aac8b2056', 'af7d56fd-dc82-494b-bfed-02cc4daf1e10', 'Provide students with the opportunity to experience different laboratory environments. Students gain exposure to graduate research, learn awide variety of laboratory techniques, become familiar with BIOE faculty, and develop insight into personal research interests and direction. Laboratory rotations are required in the Fall and Spring of the first year of the Ph.D. program. BIOE605: Laboratory Rotations 1 will be held in the Fall semester; BIOE606: Laboratory Rotations 2 will be held in the Spring semester.', 'Provide students with the opportunity to experience different laboratory environments. Students gain exposure to graduate research, learn awide variety of laboratory techniques, become familiar with BIOE faculty, and develop insight into personal research interests and direction. Laboratory rotations are required in the Fall and Spring of the first year of the Ph.D. program. BIOE605: Laboratory Rotations 1 will be held in the Fall semester; BIOE606: Laboratory Rotations 2 will be held in the Spring semester.')
/
