INSERT INTO KSLU_RICH_TEXT_T (VER_NBR, OBJ_ID, ID, FORMATTED, PLAIN) VALUES (0, '813e0afd-037b-46a7-8d89-11cf5eb8fcea', 'db6dd0da-ab94-4ac0-9c74-ef2c137f0dd0', 'Designed to help criminology students understand and apply three important components of statistics: decriptive statistics (including probability theory), fundamentals of statistical inference, and regression analysis. Course assumes familiarity with basic descriptive statistics. The emphasis of the classes on descriptive statistics is the calculation and interpretation of summary statistical measures for describing raw data. Covers the basic rules of probability and different probabilistic processes that could describe criminal activity. The sessions on fundamentals of statistical inferences are designed to  provide background for executing and interpreting hypothesis tests and confidence intervals. The latter portion of the course focuses on regession analysis. Uses the statistical software, Stata.', 'Designed to help criminology students understand and apply three important components of statistics: decriptive statistics (including probability theory), fundamentals of statistical inference, and regression analysis. Course assumes familiarity with basic descriptive statistics. The emphasis of the classes on descriptive statistics is the calculation and interpretation of summary statistical measures for describing raw data. Covers the basic rules of probability and different probabilistic processes that could describe criminal activity. The sessions on fundamentals of statistical inferences are designed to  provide background for executing and interpreting hypothesis tests and confidence intervals. The latter portion of the course focuses on regession analysis. Uses the statistical software, Stata.')
/
