INSERT INTO KSLU_RICH_TEXT_T (VER_NBR, OBJ_ID, ID, FORMATTED, PLAIN) VALUES (0, '720ecf10-7c6c-40e8-a0cb-2081765dd46e', 'ee678342-0a9f-4152-9fef-0719d1997109', 'The Biological Sciences Graduate Program (BISI) offers outstanding opportunities for research and discovery within and across contemporary disciplines. Faculty mentors help students investigate exciting questions, in directions driven by each student''s interests and curiosity. Enthusiastic and interactive colleagues, agile minds, and cutting-edge technologies work together to advance and apply science. The goal of the Biological Sciences Program is to enable students to obtain the best training in their intended research areas, to work closely with outstanding faculty, and to prepare for successful futures contributing to innovative advances and effective teaching in the life sciences.', 'The Biological Sciences Graduate Program (BISI) offers outstanding opportunities for research and discovery within and across contemporary disciplines. Faculty mentors help students investigate exciting questions, in directions driven by each student''s interests and curiosity. Enthusiastic and interactive colleagues, agile minds, and cutting-edge technologies work together to advance and apply science. The goal of the Biological Sciences Program is to enable students to obtain the best training in their intended research areas, to work closely with outstanding faculty, and to prepare for successful futures contributing to innovative advances and effective teaching in the life sciences.')
/
