INSERT INTO KSLU_RICH_TEXT_T (VER_NBR, OBJ_ID, ID, FORMATTED, PLAIN) VALUES (0, '98911c0e-b3b4-4c2f-b2bb-f35bef6a3c28', 'f22b808e-4ef9-480a-9c39-f9e16d04421d', 'One lecture or one two-hour laboratory period a week for each credit hour. Lectures, group discussions or laboratory sessions on selected topics such as: aquatic insects, biological control of insects, entomological literature, forest entomology, history of entomology, insect biochemistry, insect embryology, immature insects, insect behavior, insect communication, principles of entomological research.', 'One lecture or one two-hour laboratory period a week for each credit hour. Lectures, group discussions or laboratory sessions on selected topics such as: aquatic insects, biological control of insects, entomological literature, forest entomology, history of entomology, insect biochemistry, insect embryology, immature insects, insect behavior, insect communication, principles of entomological research.')
/
