INSERT INTO KSLU_RICH_TEXT_T (VER_NBR, OBJ_ID, ID, FORMATTED, PLAIN) VALUES (0, 'b4f605c2-c4c3-4ed8-8328-71baf44a2bca', 'f27089f0-ffac-4d46-a3d1-0a2bd22f92e7', 'Analysis of various renewable energy technologies and their current applications. Emphasis will be placed on energy consumption, efficiency, the ease of transition to renewable alternatives, and net energy comparisons with fossil fuel alternatives. Quantification of incident solar energy is covered in detail along with basic science and physics concepts underlining energy conversion and carbon sequstration. Technologies include hydroelectric, wind and wave turbines, solar thermal conversion, photovoltaic, hydrogen, fuel cells, geothermal, biogas, and biofuel.', 'Analysis of various renewable energy technologies and their current applications. Emphasis will be placed on energy consumption, efficiency, the ease of transition to renewable alternatives, and net energy comparisons with fossil fuel alternatives. Quantification of incident solar energy is covered in detail along with basic science and physics concepts underlining energy conversion and carbon sequstration. Technologies include hydroelectric, wind and wave turbines, solar thermal conversion, photovoltaic, hydrogen, fuel cells, geothermal, biogas, and biofuel.')
/
