INSERT INTO KSLU_RICH_TEXT_T (VER_NBR, OBJ_ID, ID, FORMATTED, PLAIN) VALUES (0, '1d308cb5-c833-48ad-ba83-d6ff921a624c', 'f83067af-6012-422c-bb3f-9f2bfa4f404a', 'It will familiarize participants with dynamic systems modeling with applications to both ecological and economic systems. We will use STELLA, an icon-based dynamic modeling software package which is very easy to learn and use, and requires no previous math or modeling experience. STELLA runs in both the Macintosh and Windows operating systems.', 'It will familiarize participants with dynamic systems modeling with applications to both ecological and economic systems. We will use STELLA, an icon-based dynamic modeling software package which is very easy to learn and use, and requires no previous math or modeling experience. STELLA runs in both the Macintosh and Windows operating systems.')
