INSERT INTO KSLU_RICH_TEXT_T (VER_NBR, OBJ_ID, ID, FORMATTED, PLAIN) VALUES (0, '2ffe93b1-d67c-4acb-b4c3-4114951bf445', 'f9879245-6996-4a59-9550-2715d355dbb3', 'Comprehensive analysis of the ecology and management of wetlands and submersed aquatic vegetation at several scales of organization from physiological, through population, community, and systems levels. Research studies from the Chesapeake Bay watershed are discussed, as well as underlying biogeochemical processes and forcing functions (hydrology, nutrient input, etc.) accounting for systems behavior. Couplings with surrounding systems on land-margin interface will be emphasized, along with applications to current management issues. Paper is required. Field trips and lab work will complement topics covered in  the lectures.', 'Comprehensive analysis of the ecology and management of wetlands and submersed aquatic vegetation at several scales of organization from physiological, through population, community, and systems levels. Research studies from the Chesapeake Bay watershed are discussed, as well as underlying biogeochemical processes and forcing functions (hydrology, nutrient input, etc.) accounting for systems behavior. Couplings with surrounding systems on land-margin interface will be emphasized, along with applications to current management issues. Paper is required. Field trips and lab work will complement topics covered in  the lectures.')
/
